window.bookSummaryJSON = "<p><b>#1 INTERNATIONAL BEST SELLER • Lisbeth Salander returns, in a trailblazing new installment to the Girl with the Dragon Tattoo series • Also known as the Millennium series</b></p> <p>Change is coming to Sweden’s far north: its untapped natural resources are sparking a gold rush with the criminal underworld leading the charge. But it’s not the prospect of riches that brings Lisbeth Salander to the small town of Gasskas. She has been named guardian to her niece Svala, whose mother has disappeared. Two things soon become clear: Svala is a remarkably gifted teenager—and she’s being watched.</p> <p>Mikael Blomkvist is also heading north. He has seen better days. <i>Millennium</i> magazine is in its final print issue, and relations with his daughter are strained. Worse still, there are troubling rumors surrounding the man she’s about to marry. When the truth behind the whispers explodes into violence, Salander emerges as Blomkvist’s last hope.</p> <p>A pulse-pounding thriller, <i>The Girl in the Eagle’s Talons </i>sees Salander and Blomkvist navigating a world of conspiracy and betrayal, old enemies and new friends, ice-bound wilderness and the global corporations that threaten to tear it apart.</p>"; 
